const ContactPage = () => {
  return (
    <div>
        <div className='contact-header w-75 mx-auto'>
            <img className='logo' src="https://support.mamaearth.in/hc/theming_assets/01HZQ05N4TH4YBHWSHZDMT5FHJ"></img>
            <p>Go to mamaearth website</p>
        </div>

    </div>
  )
}

export default ContactPage
